


VALUES(1, NULL, 1, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p class="ql-align-justify"><strong style="background-color: white; color: black;">OBSERVAÇÕES</strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: white; color: black;">A amostra não pode ter partículas em suspenção, caso tenha, a filtragem é de responsabilidade do usuário; </span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: white; color: black;">O equipamento será ligado todo 1° dia útil do mês ou quando alcançarmos o número de 40 amostras.</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: white; color: black;">É de responsabilidade do usuário o prepara da amostra. Recomendações para a abertura de amostra seguem os seguintes passos:</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: white; color: black;">2 mL de amostra;</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: white; color: black;">5 mL de Água Régia (1 parte de HNO</span><sub style="background-color: white; color: black;">3</sub><span style="background-color: white; color: black;"> para 3 partes de HCl);</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: white; color: black;">Bloco digestor por 4 horas a 80°C;</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: white; color: black;">Solução transferida para béquer de 50 mL, colocar em chapa de aquecimento até quase secura;</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: white; color: black;">Filtra-se a solução e avolume-se com água Ultra Pura em balão volumétrico de 20 mL.</span></li></ol><p><br></p><p class="ql-align-justify"><strong>OS USUÁRIOS SE COMPROMETEM EM:</strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Caso o usuário não vir acompanhar, as amostras serão injetadas no método requerido, independente da qualidade da análise;</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Caso necessário, a diluição é de responsabilidade do usuário;</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Deve ser entregue 20 mL de amostra para cada elemento a ser analisado, filtradas em filtro com tamanho de poro de 0.45 micrômetros (hidrofílico ou hidrofóbico, dependendo da matriz);</span></li></ol>', 'AA', 'Complemento');
VALUES(1, NULL, 2, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p><strong>OBSERVAÇÃO: </strong></p><ol><li data-list="bullet"><span class="ql-ui" contenteditable="false"></span>O usuário é responsável por realizar a análise. </li><li data-list="bullet"><span class="ql-ui" contenteditable="false"></span>A central de análises dará o treinamento necessário para a correta utilização do equipamento.</li></ol><p><br></p><p><strong>Dimensões do porta amostra (figura abaixo):</strong></p><ol><li data-list="bullet"><span class="ql-ui" contenteditable="false"></span>Diâmetro: 4 cm</li><li data-list="bullet"><span class="ql-ui" contenteditable="false"></span>Altura: 1,1 cm</li></ol><p><br></p><p><img src="data:image/png;base64,"></p>', 'AW', 'Complemento');
VALUES(1, NULL, 3, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p class="ql-align-justify"><strong style="background-color: white;">OBSERVAÇÃO: </strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span>A extração dos compostos e filtração, utilizando filtro 0,45 micrômetros (µm), é de responsabilidade e obrigatoriedade do usuário;</li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span>Caso o usuário não vir acompanhar, as amostras serão injetadas no método requerido, independente da qualidade da análise;</li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span>Deve ser entregue a curva de calibração de padrões analíticos de interesse com concentrações adequadas às amostras (de preferência, solubilizada na fase móvel - condição inicial do método);</li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span>O volume mínimo de 1 mL de amostra deve ser entregue em vials de 2 mL, filtradas em filtro com tamanho de poro de 0,45 micrômetros (hidrofílico ou hidrofóbico, dependendo da matriz);</li><li data-list="bullet"><span class="ql-ui" contenteditable="false"></span>Deve-se destacar que se tiver corpo de fundo na amostra no dia da análise, ela não poderá ser realizada. </li><li data-list="bullet"><span class="ql-ui" contenteditable="false"></span>Na hora da filtração, a necessidade de fazer força para filtrar indica a indispensabilidade de um TRATAMENTO PRÉVIO, COMO CENTRIFUGAÇÃO, à filtração;</li></ol><p><br></p><p class="ql-align-justify"><strong>Dimensões do vial (figura abaixo):</strong></p><p class="ql-align-justify"><strong style="background-color: white;">- </strong><span style="background-color: white;">Diâmetro:1 cm</span></p><p class="ql-align-justify"><span style="background-color: white;">- Altura: 3,3 cm</span></p><p class="ql-align-justify"><br></p><p><img src="data:image/png;base64,"></p><p><br></p><p class="ql-align-justify"><strong>OS USUÁRIOS SE COMPROMETEM EM:</strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">O usuário se responsabiliza por nos enviar a metodologia a ser utilizada com antecedência para que possamos avaliar se temos as condições para realizar os ensaios (Coluna, fluxo, etc.);</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">As amostras precisam ser líquidas, filtradas com filtro 45 µm em condição homogênea e sem sólidos em suspensão ou corpo de fundo;</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">As amostras devem ser entregues em vials de 2 mL, filtradas em filtro com tamanho de poro de 0.45 micrômetros (hidrofílico ou hidrofóbico, dependendo da matriz);</span></li></ol><p><br></p>', 'CLAE', 'Complemento');
VALUES(1, NULL, 4, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p><strong>OBSERVAÇÃO: </strong></p><ol><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span>O usuário é responsável por realizar a análise. A central de análises dará o treinamento necessário para a correta utilização do equipamento;</li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">O usuário é responsável por trazer a bobina de papel utilizados em máquinas térmicas (papel para máquina de cartão de crédito) utilizada para emissão dos resultados. Caso contrário, o usuário é responsável por anotar os dados em um papel. Dimensões da bobina (figura abaixo):</span></li></ol><p><span style="color: black;">- Diâmetro: 4,7 cm</span></p><p><span style="color: black;">- Comprimento: 5,9 cm</span></p><p class="ql-align-center"><span style="color: black;"><img src="data:image/jpeg;base64," alt="Bobina de papel térmico 57x30m para relógio de ponto digital biométrico  (REP) ou máquina registradora. Tamanho padrão 57 mm X 30 metros. Registro  do ..." height="189" width="189"></span></p><p><br></p><p><br></p><p><strong>Dimensões da cubeta para líquido (figura abaixo):</strong></p><p><strong>- </strong>Altura: 4,51 cm</p><p>- Largura:1,3 cm</p><p>- Comprimento: 3,5 cm</p><p class="ql-align-center"><strong><img src="data:image/jpeg;base64," height="189" width="178"></strong></p><p class="ql-align-center"><br></p><p><strong>Dimensões da cubeta para sólido (figura abaixo):</strong></p><p><strong>- </strong>Diâmetro: 4,4 cm</p><p>- Altura:1,7 cm</p><p class="ql-align-center"><br></p><p class="ql-align-center"><strong><img src="data:image/jpeg;base64," height="189" width="219"></strong></p><p><br></p><p><br></p><p class="ql-align-justify"><strong>OS USUÁRIOS SE COMPROMETEM EM:</strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Providenciar a preparação da amostra antecipadamente;</span></li></ol><p class="ql-align-justify"><strong style="background-color: yellow; color: black;">OBS:</strong><span style="background-color: yellow; color: black;"> Será responsabilidade do solicitante qualquer dano causado ao equipamento pelo não cumprimento das orientações.</span></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Quantidade:</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Para o caso de amostras líquidas recomenda-se o equivalente à 15 mL;</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Para o caso de amostras sólidas recomenda-se o equivalente uma área de 2 x 2 cm;</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Para o caso de amostras sólidas em pó recomenda-se quantidade suficiente para cobrir uma moeda de 1 real;</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Que o usuário esteja presente no momento da análise, agendando um horário para o acompanhamento.</span></li></ol><p class="ql-align-justify"><br></p><p><br></p><p>O equipamento imprime os resultados logo após a finalização da análise, sendo essas impressões entregues ao solicitante. Caso contrário, o usuário pode anotar os dados em um papel.</p>', 'COR', 'Complemento');
VALUES(1, NULL, 5, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p><strong>Dimensões do porta amostra (figura abaixo):</strong></p><p><strong>- </strong>Comprimento: 4,8 cm</p><p>- Largura:3,7 cm</p><p><br></p><p class="ql-align-center"><img src="data:image/jpeg;base64," height="189" width="200"></p><p><br></p><p class="ql-align-justify"><strong>OS USUÁRIOS SE COMPROMETEM EM:</strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Providenciar a preparação da amostra antecipadamente, conforme descrito abaixo;</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Tipo:</span></li><li data-list="ordered" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;"> Sólidos, como pedaços de plástico ou metal, desde que tenham superfície plana: Tamanho máximo de 1x1 cm e até 2 mm de espessura;</span></li><li data-list="ordered" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Pó: Granulometria pequena, aspecto de talco/amido. Granulometrias maiores, como areia, não podem ser fixadas no porta amostra do equipamento;</span></li><li data-list="ordered" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Condição: homogênea e seca (que não contenha água e/ou qualquer tipo de solvente ou componente volátil).</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Quantidade: Recomenda-se o equivalente a 3 mL de um tubo do tipo “eppendorf”;</span></li></ol><p><br></p><p class="ql-align-justify">Caso o usuário necessite identificar os picos dos difratogramas no <em>software</em> do equipamento, o mesmo deve marcar um novo horário para acompanhamento da análise. Não serão realizadas identificações sem o acompanhamento do usuário.</p><p><br></p>', 'DRX', 'Complemento');
VALUES(1, NULL, 6, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p><strong style="color: black;">Dimensões do cadinho (Figura abaixo):</strong><span style="color: black;"> </span></p><p class="ql-align-justify"><span style="color: black;">- Altura: 2 mm</span></p><p class="ql-align-justify"><span style="color: black;">- Diâmetro: 5 mm</span></p><p class="ql-align-justify"><br></p><p class="ql-align-center"><span style="color: black;"><img src="data:image/jpeg;base64," height="179" width="206"></span></p><p class="ql-align-justify"><br></p><p><br></p><p class="ql-align-justify"><strong>OS USUÁRIOS SE COMPROMETEM EM:</strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Providenciar a preparação da amostra antecipadamente, conforme descrito abaixo;</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow; color: black;">Tipo:</span></li><li data-list="ordered" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;"> Filmes, peças ou pó: Granulometria pequena, compatível com peneira de 710 µm de abertura (malha 25) ou menor;</span></li><li data-list="ordered" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Condição: homogênea. </span></li></ol><p><br></p><p>Caso o usuário tenha interesse, os dados da extensão .001 podem ser abertos no software livre do equipamento (TA Universal Analysis). Para fazer o download, <a href="https://www.tainstruments.com/support/software-downloads-support/downloads/#tab-1442864986189-3-2" rel="noopener noreferrer" target="_blank" style="color: rgb(5, 99, 193);">CLIQUE AQUI</a>. </p>', 'DSC', 'Complemento');
VALUES(1, NULL, 7, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p class="ql-align-justify"><strong>OS USUÁRIOS SE COMPROMETEM EM:</strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Providenciar a preparação da amostra antecipadamente, conforme descrito abaixo;</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Tipo:</span></li><li data-list="ordered" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;"> Sólidos, como pedaços de plástico ou metal, desde que tenham superfície plana: Tamanho máximo de 1x1 cm e até 2 mm de espessura. Condição: homogênea e seca;</span></li><li data-list="ordered" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Pó: Granulometria pequena, aspecto de talco/amido. Granulometrias maiores, como areia, não podem ser fixadas no KBr. Condição: homogênea e seca;</span></li><li data-list="ordered" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Líquido: Filtrados com filtro 45 µm. Condição: homogênea;</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Quantidade: Recomenda-se o equivalente a 3 mL de um tubo do tipo “eppendorf”;</span></li></ol><p class="ql-align-center"><br></p><p><br></p>', 'FTMIR', 'Complemento');
VALUES(1, NULL, 8, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p><strong>Dimensões do porta amostra (figura abaixo): </strong></p><p>- Diâmetro: 3 cm</p><p>- Altura: 7,5 cm</p><p><br></p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-justify"><strong>OS USUÁRIOS SE COMPROMETEM EM:</strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Providenciar a preparação da amostra antecipadamente, conforme descrito abaixo;</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Condição: devem estar secas, não sendo permitida a análise de material úmido ou que contenha água e/ou qualquer tipo de solvente ou componente volátil. </span></li><li data-list="bullet" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Pó: Granulometria pequena, aspecto de talco/amido;</span></li><li data-list="bullet" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Sólidos/filmes: Como pedaços de plástico ou metal, desde que tenham superfície plana: Tamanho máximo de 1x1 cm e até 5 mm de espessura;</span></li></ol><p class="ql-align-justify"><strong style="background-color: yellow;">OBS:</strong><span style="background-color: yellow;"> Será responsabilidade do solicitante qualquer dano causado ao equipamento pelo não cumprimento das exigências</span></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Quantidade: Recomenda-se o equivalente a um tubo do tipo “eppendorf” (3 mL);</span></li><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Caso o usuário deseje estar presente no momento da análise, o mesmo deve marcar um horário para acompanhamento.</span></li></ol><p><br></p>', 'MEV', 'Complemento');
VALUES(1, NULL, 9, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p><strong>Dimensão do cadinho de alumina:</strong></p><ol><li data-list="bullet"><span class="ql-ui" contenteditable="false"></span>Diâmetro: 5 mm</li></ol><p><strong>Dimensão do cadinho de platina:</strong></p><ol><li data-list="bullet"><span class="ql-ui" contenteditable="false"></span>Diâmetro: 5 mm</li></ol><p class="ql-align-justify"><br></p><p class="ql-align-center"><img src="data:image/jpeg;base64," height="189" width="149">  <img src="data:image/jpeg;base64," height="189" width="143"></p><p><br></p><p class="ql-align-justify"><strong>OS USUÁRIOS SE COMPROMETEM EM:</strong></p><ol><li data-list="ordered"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Providenciar a preparação da amostra antecipadamente, conforme descrito abaixo;</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Tipo:</span></li><li data-list="ordered" class="ql-indent-2"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;"> Filmes, peças ou pó: Granulometria pequena, compatível com peneira de 710 µm de abertura (malha 25) ou menor;</span></li><li data-list="ordered" class="ql-indent-1"><span class="ql-ui" contenteditable="false"></span><span style="background-color: yellow;">Condição: homogênea. </span></li></ol><p><br></p><p>Caso o usuário tenha interesse, os dados da extensão .001 podem ser abertos no software livre do equipamento (TA Universal Analysis). Para fazer o download, <a href="https://www.tainstruments.com/support/software-downloads-support/downloads/#tab-1442864986189-3-2" rel="noopener noreferrer" target="_blank" style="color: rgb(5, 99, 193);">CLIQUE AQUI</a>. </p>', 'TGADTA', 'Complemento');
VALUES(1, NULL, 10, NULL, NULL, NULL, 'Li, entendi e concordo com os termos apresentados.', '<p><strong style="color: black;"><u>É responsabilidade do usuário interpretar os resultados fornecidos.</u></strong></p>', NULL, 'Resultado');